import cardElementStyles from "./CardElement.module.css";
import data from "../../utils/data";
import { v4 as uuidv4 } from "uuid";
import { useDispatch, useSelector } from "react-redux";
export default function CardElement() {
  const Carditems = useSelector((store) => store.cardItem.items);
  return (
    <div className={cardElementStyles.main}>
      {Carditems.map((item) => {
        return (
          <div className={cardElementStyles.box} key={item.props.id4}>
            <img
              className={cardElementStyles.img}
              src={item.props.image}
              key={item.props.id4}
            ></img>
            <p className={cardElementStyles.name}>
              {item.props.name} key={item.props.id4}
            </p>
          </div>
        );
      })}
    </div>
  );
}
